import '../styles/style.css';
import '../styles/popup.css';
import '../styles/webfont.css';
import '../styles/info_style.css';
import '../styles/common.css';



function Footer() {
    return (
        <>
            <div id="container">
            <nav className="footer-nav-wrap">
                <div className="ft-nav-list">
                    <a href="" className="login active"><i></i><span>로그인</span> </a>
                    <a href="" className="quest"><i></i><span>문의하기</span> </a>
                    <a href="" className="home"><i></i><span>홈</span> </a>
                    <a href="" className="my"><i></i><span>내정보</span> </a>
                    <a href="" className="menu"><i></i><span>더보기</span> </a>
                </div>
            </nav>
            </div>
        </>
    )
}


export default Footer;
